const NavBar = () => {
    return (
        <>
            <header class=" bg-black text-gray-600 body-font h-[200px]">
                  <div class="container mx-auto flex flex-wrap p-5 pt-20 flex-col md:flex-row items-center">

                    <img className="absolute left-0 h-[150px] w-[150px] ml-10 " src={require('./cnslogo.png')} />
                    <img className="absolute right-0 h-[150px] w-[150px] mr-10 " src={require('./Plogo.png')} />
                </div>
            </header>
        </>
    )
}

export default NavBar;
